import React, { Component } from 'react';
import NavBar from ''
import { connect } from 'react-redux';
import { fetchCollaborators } from './actions/collaborators';
import { fetchTeams } from './actions/teams';
import { Switch, Route } from 'react-router-dom'

import './App.css';

class App extends Component {

  componentDidMount() {
    this.props.fetchCollaborators()
    this.props.fetchTeams()
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <h1>Hackathon Teamup</h1>
        </header>
        <NavBar />
        <Switch>
          <Route exact path="/cars/new" component={NewTeam}/>
          <Route path="/cars" component={CarsContainer}/>
          <Route exact path="/reviews" component={ReviewsContainer}/>
          <Route path="/" component={Home}/>
        </Switch>
      </div>
    );
  }
}

export default connect(null, { fetchCollaborators, fetchTeams })(App)
